{"commands": [{"bindings": {}, "collapsed": false, "command": "\n%md-sandbox\n\n<div style=\"text-align: center; line-height: 0; padding-top: 9px;\">\n  <img src=\"https://databricks.com/wp-content/uploads/2018/03/db-academy-rgb-1200px.png\" alt=\"Databricks Learning\" style=\"width: 1200px\">\n</div>", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "dc304879-5e99-443d-ad69-ee1a382242de", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "b66332cc-b013-48c5-8b25-4a893f22b461", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 1, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md-sandbox\n<img src=\"https://files.training.databricks.com/images/Apache-Spark-Logo_TM_200px.png\" style=\"float: left: margin: 20px\"/>\n\n# Silver To Gold - Price Over Time\n\nIn this notebook we are preparing a dataset for a time series analysis. We are creating two columns from the Stock Transactions table. The first column will show the average price change over time and the second one will present the price change expressed as a percentage. We are calculating this for the tickers with the highest volumes in the selected time period. \n\nWe will also practice using the visualization tools available on Databricks.\n\n## In this exercise you will:\n* Find out how to implement rolling average and percentage changes using timeseries data\n* Practice extracting values from rows\n* Learn to use Databricks visualization tools\n\n## Prerequisites\n* Web browser: **Chrome**\n* A cluster configured with **8 cores** and **DBR 7.0**", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "8c6be28c-03fd-4d2a-8fc9-2b06b39cddff", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "9e42a552-6701-4bf5-8032-fc8e6f409f6b", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 2, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md\n## ![Spark Logo Tiny](https://files.training.databricks.com/images/105/logo_spark_tiny.png) Classroom-Setup<br>\n\nFor each lesson to execute correctly, please make sure to run the **`Classroom-Setup`** cell at the start of each lesson (see the next cell) and the **`Classroom-Cleanup`** cell at the end of each lesson.", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "14d4dd2d-8bd9-4360-878f-cf41598785df", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "76fe73fb-b730-447d-95dc-aee41931d665", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 3, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%run ./Includes/PCF-16G-ClassroomSetup", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "43dc4b33-d9e8-4e30-8a17-32553ad359a6", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "8e7d3f8d-ec97-426d-bed8-3186d18e3872", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 4, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "%md-sandbox\n## ![Spark Logo Tiny](https://files.training.databricks.com/images/105/logo_spark_tiny.png) Steps to complete<br>\nImplement the **`challenge()`** function to achieve the following:\n\n- This exercise is made up of three steps:\n  1. Extract a list of tickers with the highest volumes.\n  2. Create a moving average using a time window for these tickers.\n  3. And finally, generate a new field showing the percentage price change over time.\n\n#### Step 1: Extract the list of items\n- Read **`silverStockOrdersPath`** into a DataFrame named **`stockTransactions`**.\n- Get the list of **`ticker`** with the highest volume: \n  * You need to group the DataFrame by **`ticker`** and calculate the sum of **`volume`**.\n  * Only keep the first two rows.\n  * Extract the **`ticker`** from the the rows and make a list out of them.\n\n#### Step 2: Create a moving daily average price\n- Create a new DataFrame by using the **`stockTransactions`** you read in the first step to transform:\n  * Filter for records where the **`ticker`** is in the list you generated above.\n  * Group it by a 1-day moving window over **`order_timestamp`** and **`ticker`**. Keep the slide interval at 1 day, too.\n  * The aggregation has to compute the average of **`price`** over the identified time window and the ticker, rounded to the second decimal.\n  * Order it by date and the **`ticker`**.\n  * Rename the datetime window column **`date`** and rename the average of **`price`** **`daily_average`**.\n  * By the end of this step you will only need the **`date`**, **`ticker`** and the **`daily_average`** fields.\n  * Filter the result to include records from the time period between the 1st and the 15th of September 2019 (1 and 15 included).\n\n#### Step 3: Create a percentage change of price column\n- Create a window partitioned by the **`ticker`** and ordered by **`date`**.\n- Create a new DataFrame transforming the one in Step 2 above by using this window:\n  * Generate a new column named **`perc_change`**, rounded to the fourth decimal.\n  * You need to compute the difference between the current **`daily_average`** and the one lagging behind over the window you generated.\n  * Divide this difference by 100.\n- Write the result to **`targetDirectory`** as a Delta table, using the overwrite mode.\n- Return the resulting DataFrame.\n- The expected output schema is:\n\n|name|type|\n|---|---|\n|date|TimestampType|\n|ticker|StringType|\n|daily_average|DoubleType|\n|perc_change|DoubleType|\n\n<p> **`silverStockOrdersPath`** and **`targetDirectory`** are already defined in your environment.\n\n\n### Visual Comparison\nModify the output of **`display()`** to display a _Line Chart_ and a _Bar Chart_ one after the other (this is an untestable requirement):\n1. Display a line chart of **`daily_average`** over time, grouped by ticker.\n2. Display a bar chart of **`perc_average`** over time, grouped by ticker.\n\nThe first diagrams should look similar to this:<br/>\n<img src=data:image/png;base64, style=\"width:300px;height:200px;\">", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "diffInserts": [], "displayType": "table", "error": null, "errorSummary": null, "finishTime": 0, "globalVars": {}, "guid": "916e77a2-1666-4aa3-8005-8280fe287cbe", "height": "auto", "hideCommandCode": false, "hideCommandResult": false, "iPythonMetadata": null, "inputWidgets": {}, "latestUser": "", "latestUserId": null, "nuid": "fd99d6fd-aa97-4bec-b3e6-8cb3abf1eac5", "origId": 0, "parentHierarchy": [], "pivotAggregation": null, "pivotColumns": null, "position": 5, "results": null, "showCommandTitle": false, "startTime": 0, "state": "finished", "streamStates": {}, "submitTime": 0, "subtype": "command", "version": "CommandV1", "width": "auto", "workflows": [], "xColumns": null, "yColumns": null}, {"bindings": {}, "collapsed": false, "command": "// TODO\n\ndef challenge(spark:org.apache.spark.sql.SparkSession, silverStockOrdersPath:String, targetDirectory:String) : DataFrame = {\n\n  // #### Step 1: Extract the list of items\n  \n  // Read `silverStockOrdersPath` into a DataFrame named `stockTransactions`.\n  \n  // Get the list of `ticker` with the highest volume in stockTransactions (aggregate, take 2 and extract row values).\n\n  // #### Step 2: Create a moving daily average price\n  \n  // Create a new DataFrame by using the `stockTransactions` you read in the first step to transform.\n  // Filter for records where the `ticker` is in the list you generated above.\n  \n  // Group it by a 1-day moving window of `order_timestamp` and the  `ticker`. Hint: use a window function.\n  // The aggregation has to compute the average of `price` over the identified time window and the ticker, rounded to the second decimal.\n  \n  // Order it by the datetime window you generated and the `ticker`.\n  \n  // Rename the datetime window column `date`, rename average of `price` `daily_average`.\n  // By the end of this step you will only need the `date`, `ticker` and the `daily_average` fields.\n  \n  // Filter the result to include the records from the time period between the 1st and the 15th of September 2019 (1 and 15 included).\n  \n  // #### Step 3: Create a percentage change of the price column\n  \n  // Create a Window partitioned by the `ticker` and ordered by `date`. Hint: use the pyspark.sql.window module.\n  \n  // Create a new DataFrame transforming the one in Step 2 above by using this window.\n  // Generate a new column named `perc_change`, rounded to the fourth decimal:\n  // * You need to compute the difference between the current `daily_average` and the one lagging behind over the window you generated.\n  // * Divide this difference by 100.\n  \n  // Write the result to `targetDirectory` as a Delta table, using the overwrite mode.\n  \n  // Return the resulting DataFrame.\n  \n  return FILL_IN.DATAFRAME\n}\n\nval finalDF = challenge(spark, silverStockOrdersPath, targetDirectory)\ndisplay(finalDF)\n\n// ### Visual Comparison\n// Modify the output of **`display()`** to display a Line Chart and a Bar Chart one after the other (this is an untestable requirement):\n//  1. Display a line chart of **`daily_average`** over time, grouped by ticker.\n//  2. Display a bar chart of **`perc_average`** over time, grouped by ticker.", "commandTitle": "", "commandType": "auto", "commandVersion": 0, "commentThread": [], "commentsVisible": false, "customPlotOptions": {}, "datasetPreviewNameToCmdIdMap": {}, "diffDeletes": [], "di